import React from "react";
import styled from "styled-components";
import Menu from "./menu";

const Landing = () => {
  return (
    <div>
      <Menu></Menu>
      <Section1>
        <GetStarted>
          <div className="leftSection">
            <div className="header">Create beautiful apps quickly.</div>
            <div className="description">
              Blockchain UI is a simple, modular and accessible component
              library that gives you the building blocks you need to build your
              own apps.
            </div>
            <div className="getStartedButton">
              <GetStartedButton>Get Started</GetStartedButton>{" "}
              <div className="contactUs">Or contact Us</div>
            </div>
          </div>
          <div className="rightSection"></div>
        </GetStarted>
        <OurPartners>
          <div className="header">Our Partners</div>
          <div className="partners">
            <Partner />
            <Partner />
            <Partner />
            <Image />
          </div>
        </OurPartners>
      </Section1>
    </div>
  );
};

export default Landing;

const Section1 = styled.div`
  width: 100%;
  height: 1309px;
  left: 0px;
  top: 0px;

  background: linear-gradient(
    335.93deg,
    #ffffff 30.99%,
    rgba(255, 255, 255, 0) 100%
  );
`;

const GetStarted = styled.div`
  display: flex;
  flex-direction: row;
  height: 600px;
  background-color: lightgrey;

  .leftSection {
    width: 50%;
    height: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    padding: 0 150px;
    background-color: lightgrey;
  }

  .rightSection {
    width: 50%;
    height: 100%;
    padding: 0 150px;

    background-image: url("/assets/n.jpeg");
    background-size: cover;
    background-position: center;
  }

  .header {
    font-size: 80px;
    font-weight: 700;
  }

  .description {
    margin-top: 25px;
    font-style: normal;
    font-weight: 400;
    font-size: 20px;
    line-height: 30px;
    color: #475569;
  }

  .getStartedButton {
    display: flex;
    flex-direction: row;
    align-items: center;
    margin-top: 25px;
    width: 100%;
  }

  .contactUs {
    margin-left: 20px;
    font-style: normal;
    font-weight: 400;
    font-size: 16px;
    line-height: 28px;
    color: #475569;
  }
`;

const GetStartedButton = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  background: #2d3766;
  border-radius: 50px;
  width: 159px;
  height: 59px;

  font-weight: 700;
  font-size: 16px;
  line-height: 19px;
  text-align: center;
  color: #ffffff;
`;

const OurPartners = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: lightgrey;
  height: 150px;

  .header {
    font-style: normal;
    font-weight: 700;
    font-size: 16px;
    line-height: 19px;
    text-align: center;
    letter-spacing: 1.66667px;
    text-transform: uppercase;
    color: #8283d3;
  }

  .partners {
    display: flex;
    flex-direction: row;
  }
`;


